package main

import (
	"fmt"
	"math"
	"strings"
)

const input = ""

func main() {
	puzzle1()
	puzzle2()
}

func puzzle1() {
	result := make([]rune, 0, len(input))

	for _, c := range input {
		if len(result) > 0 {
			last := result[len(result)-1]

			if last != c && strings.ToLower(string(last)) == strings.ToLower(string(c)) {
				result = result[:len(result)-1]
				continue
			}
		}

		result = append(result, c)
	}

	fmt.Println(len(result))
}

func puzzle2() {
	min := math.MaxInt32

	for i := 'a'; i <= 'z'; i++ {
		modified := input
		modified = strings.Replace(modified, string(rune(i)), "", -1)
		modified = strings.Replace(modified, strings.ToUpper(string(rune(i))), "", -1)

		result := make([]rune, 0, len(modified))

		for _, c := range modified {
			if len(result) > 0 {
				last := result[len(result)-1]

				if last != c && strings.ToLower(string(last)) == strings.ToLower(string(c)) {
					result = result[:len(result)-1]
					continue
				}
			}

			result = append(result, c)
		}

		if len(result) < min {
			min = len(result)
		}
	}

	fmt.Println(min)
}
